#include <gtest/gtest.h>
#include "../matrix_lib/matrix_lib.h"

TEST(TestSum, basic) {
    matrix_lib::Matrix left;
    matrix_lib::Matrix right;
    matrix_lib::Matrix result;

    left = matrix_lib::Matrix{{-1, 0},
                              {7,  34}};
    right = matrix_lib::Matrix{{1,  6},
                               {50, 13}};
    result = matrix_lib::Matrix{{0,  6},
                                {57, 47}};
    EXPECT_EQ(left + right, result);

    left = matrix_lib::Matrix{{-49, -42},
                              {19,  19}};
    right = matrix_lib::Matrix{{0,  3},
                               {-7, -48}};
    result = matrix_lib::Matrix{{-49, -39},
                                {12,  -29}};
    EXPECT_EQ(left + right, result);

    left = matrix_lib::Matrix{{3,   30},
                              {-28, 32}};
    right = matrix_lib::Matrix{{-39, 4},
                               {4,   -29}};
    result = matrix_lib::Matrix{{-36, 34},
                                {-24, 3}};
    EXPECT_EQ(left + right, result);

    left = matrix_lib::Matrix{{-16, 34},
                              {-31, -25}};
    right = matrix_lib::Matrix{{-35, -5},
                               {-21, -19}};
    result = matrix_lib::Matrix{{-51, 29},
                                {-52, -44}};
    EXPECT_EQ(left + right, result);

    left = matrix_lib::Matrix{{-1, -46},
                              {40, -2}};
    right = matrix_lib::Matrix{{-2, -22},
                               {17, -5}};
    result = matrix_lib::Matrix{{-3, -68},
                                {57, -7}};
    EXPECT_EQ(left + right, result);

    left = matrix_lib::Matrix{{15,  -9},
                              {-37, -34}};
    right = matrix_lib::Matrix{{-17, 38},
                               {11,  19}};
    result = matrix_lib::Matrix{{-2,  29},
                                {-26, -15}};
    EXPECT_EQ(left + right, result);

    left = matrix_lib::Matrix{{40,  7},
                              {-42, 42}};
    right = matrix_lib::Matrix{{-2, 11},
                               {30, 12}};
    result = matrix_lib::Matrix{{38,  18},
                                {-12, 54}};
    EXPECT_EQ(left + right, result);

    left = matrix_lib::Matrix{{-15, -45},
                              {-44, 16}};
    right = matrix_lib::Matrix{{-41, 39},
                               {12,  -26}};
    result = matrix_lib::Matrix{{-56, -6},
                                {-32, -10}};
    EXPECT_EQ(left + right, result);

    left = matrix_lib::Matrix{{13, -23},
                              {-2, 27}};
    right = matrix_lib::Matrix{{-50, 1},
                               {-31, -40}};
    result = matrix_lib::Matrix{{-37, -22},
                                {-33, -13}};
    EXPECT_EQ(left + right, result);

    left = matrix_lib::Matrix{{25, 49},
                              {20, 2}};
    right = matrix_lib::Matrix{{30, -42},
                               {27, -15}};
    result = matrix_lib::Matrix{{55, 7},
                                {47, -13}};
    EXPECT_EQ(left + right, result);
}

